import React, {useState} from "react";
import Container from "@material-ui/core/Container";
import {Avatar} from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import Button from "@material-ui/core/Button";
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import {makeStyles} from "@material-ui/core/styles";
import axios from "axios";

const useStyles = makeStyles((theme) => ({
    paper: {
        marginTop: theme.spacing(8),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main,
    },
    form: {
        width: '100%', // Fix IE 11 issue.
        marginTop: theme.spacing(3),
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
    },
}));

export const SignUpForm = () => {

    const classes = useStyles();

    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [termsOfUse, setTermsOfUse] = useState("");

    const [errors, setErrors] = useState(initialErrorsState);
    const [unknownError, setUnknownError] = useState(false);
    const [unknownErrorMessage, setUnknownErrorMessage] = useState(defaultErrorMessage);

    const submit = async () => {
        await axios.post(`http://localhost:8080/signup`, {
            firstName,
            lastName,
            email,
            password,
            termsOfUse
        })
            .then(resp => console.log(resp))
            .catch(error => {
                if (error.response && error.response.data) {
                    let errorObject: any = {};
                    error.response.data.errors.forEach((e: any) => {
                        errorObject[`${e.field}`] = e.defaultMessage;
                    })
                    setErrors(errorObject);
                } else {
                    if (error.response && error.response.status === 401) {
                        setUnknownErrorMessage(usernamePasswordErrorMessage);
                    }
                    setUnknownError(true);
                }
            });;
    }

    return (
        <Container component="section" className={classes.paper}>
            <Avatar className={classes.avatar}>
                <LockOutlinedIcon/>
            </Avatar>
            <Typography component="h1" variant="h5">
                Sign up
            </Typography>
            <form noValidate className={classes.form}>
                <Grid container spacing={2}>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            autoComplete="fname"
                            name="firstName"
                            variant="outlined"
                            required
                            fullWidth
                            id="firstName"
                            label="First Name"
                            value={firstName}
                            onChange={(event => setFirstName(event.target.value))}
                            autoFocus
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            variant="outlined"
                            required
                            fullWidth
                            id="lastName"
                            label="Last Name"
                            name="lastName"
                            value={lastName}
                            onChange={(event => setLastName(event.target.value))}
                            autoComplete="lname"
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            variant="outlined"
                            required
                            fullWidth
                            id="email"
                            label="Email Address"
                            name="email"
                            autoComplete="email"
                            value={email}
                            onChange={(event => setEmail(event.target.value))}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            variant="outlined"
                            required
                            fullWidth
                            name="password"
                            label="Password"
                            type="password"
                            id="password"
                            value={password}
                            onChange={(event => setPassword(event.target.value))}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <FormControlLabel
                            control={<Checkbox
                                value="termsOfUse"
                                checked={Boolean(termsOfUse)}
                                onChange={(event => setTermsOfUse(event.target.checked+""))}

                                color="primary"/>}
                            label="I accept the terms of use."
                        />
                    </Grid>
                </Grid>
                <Button
                    type="button"
                    fullWidth
                    onClick={submit}
                    variant="contained"
                    color="primary"
                    className={classes.submit}
                >
                    Sign Up
                </Button>
            </form>
        </Container>
    );
}
